import { Col, Row } from "antd";
import IntlMessages from "util/IntlMessages";
import PendapatanHariIni from "./PendapatanHariIni";
import LatestTransaction from "./LatestTransaction"
import TransaksiHariIni from "./TransaksiHariIni";
import PendapatanBulanIni from "./PendapatanBulanIni";
import React, { useState, useEffect } from "react";
import * as moment from 'moment';

const SamplePage = () => {  
  const [latestTransaction, setLatestTransaction] = useState()
  const [moneyThisMonth, setMoneyToday] = useState()
  const [moneyLastMonth, setMoneyLastMonth] = useState()

  useEffect(() => {
    getLatestTransaction();
  }, []);

  const bulan = latestTransaction && latestTransaction.map(row => ({
    nilai: row[3].stringValue,
    tanggal_transaksi: moment(row[1].stringValue).format('YYYY-MM')
  }));

  console.log("bulan", bulan);




  const getLatestTransaction = async (dataLatest) => {

    const token = localStorage.getItem('token')
    const headers = {
      'x-api-key': '45N0Ujae7p9AWDs3ihDiU4ZDnvAMb9ZK4TXH0kCk',
      'content-type': 'application/json',
      'Authorization': `Bearer ${token}`
    }

    const response = await fetch(
      "https://api.raspi-geek.com/v1/latestorder",

      { method: "GET", headers }
    );
    const ajson = await response.json();
    // setLatestTransaction(ajson)
    setLatestTransaction(ajson.Records)
  }
  return (
    <div>
      <h2 className="title gx-mb-4"><IntlMessages id="sidebar.samplePage" /></h2>
      <div className="gx-d-flex justify-content-center">
      </div>
      <Row>
        <PendapatanHariIni  latestTransaction={latestTransaction} setLatestTransaction ={setLatestTransaction}/>
        <TransaksiHariIni latestTransaction={latestTransaction} setLatestTransaction ={setLatestTransaction}/>
        <PendapatanBulanIni  latestTransaction={latestTransaction} setLatestTransaction ={setLatestTransaction}/>
      </Row>
      <br />
      <LatestTransaction  latestTransaction={latestTransaction} setLatestTransaction ={setLatestTransaction}/>
    </div>
  );
};

export default SamplePage;
